import React from "react";
import header_img from "../assets/bhive_logo.png";
import { FaPhone } from "react-icons/fa";

const Header = () => {
  return (
    <div className="header">
      <img src={header_img} alt="logo" />
      <a href="tel:7904688429">
        <FaPhone />
      </a>
    </div>
  );
};

export default Header;
